import React from 'react';
import './App.css';
import TodoList from './component/TodoList'

class App extends React.Component{
  constructor(){
    super();
    this.todoItems = [
      'Mua bim bim',
      'Di da bong',
      'Di choi'
    ];
  }
  render() {
    return (
    <div className="App">
      {
        this.todoItems.map((item, key) => 
          <TodoList key={key} title={item}/>
        )
      }
    </div>
    );
  }
}

export default App;
